import Link from 'next/link';
import Container from '@material-ui/core/Container';

const Index = () => (
  <Container maxWidth="xl">
      <Link href="/about">
        <a>About</a>
    </Link>
    <p>React Prototyper</p>
  </Container>
);

export default Index;
